import React from 'react';
import styled from 'styled-components';
export const NavbarWrapper= styled.li`
      padding:0;
      margin: 0;
      background-color: black;
      li{
            display: inline;
            color: whitesmoke;
            padding : 10px;
            float: left;
      }

`;
